script: |
  super -f text -I q2114.spq | sort > q2114.out

inputs:
  - name: q2114.spq
    data: |
      SELECT + + 92 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( col2, + col1, + col2, + 69, + - 59 + - 12, - col0 + - col1 + + col1 );
  - name: tab2

outputs:
  - name: q2114.out
    data: |
